description:
This is the version updated to TS2013 standard in June 2013.

Drive this modern day branch line on the famous Stockton and Darlington Railway, modelled here to an unmatched level of detail in TS2013. 

Features include six realistic stations, stunning modelling of the countryside and buildings along the route and night lighting which takes full advantage of Train Simulator 2013's graphics capabilities. You can even drive all the default steam and diesel locomotives at the Locomotion National Rail Museum.




Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


